import Item from './Item';
import { Event } from '../models/event';

interface Props {
    events: Array<Event>;
    id: number;
    description: string;
    date: string;
    onDelete:(id: number) => void;
    onSearch:string;
}

const Events: React.FC<Props> = ({events, onDelete, onSearch}) => {

    const error:boolean = false;

    return (
        <>
        <h1>Event list: </h1>

        {events?.map((event, index) => {
            if (onSearch == "" || event.description.toLowerCase().includes(onSearch.toLowerCase())) {
                return (
                    <Item 
                        key={event.id}
                        id={event.id}
                        description={event.description}
                        date={event.date} 
                        events={[]}
                        onDelete={onDelete}        
                    /> 
                )} else {
                    const error = true;
                }

            })
        } 


        {error && <p className="error">{error}</p>}

    </>
    )}



export default Events
